						["custom"] = "function(e,...)\n    if e == \"CHAT_MSG_ADDON\" then\n        local prefix, msg = ...\n        \n        if prefix == \"PRMK_CLOAK\" then\n            if msg == WeakAuras.myGUID then\n                C_ChatInfo.SendAddonMessage(\"PRMK_CLOAK\", aura_env.cloak_rank() .. \":\" .. WeakAuras.myGUID, \"PARTY\")\n            else\n                local multi, guid = strsplit(\":\",msg)\n                \n                if guid then\n                    aura_env.cloaks[guid] = aura_env.sanity_multi[multi] or multi\n                end\n            end\n        end\n    end\n    \n    if e == \"UPDATE_UI_WIDGET\" then\n        if not aura_env.checked then aura_env.update_widgets() end\n        local widget = ...\n        local widget_info\n        if widget and widget.widgetType == 13 then\n            widget_info = C_UIWidgetManager.GetSpellDisplayVisualizationInfo(widget.widgetID)\n        end\n        \n        if widget_info and widget_info.shownState == 1 and aura_env.tracked_widgets[widget_info.spellInfo.spellID] then\n            local drain = aura_env.tracked_widgets[widget_info.spellInfo.spellID]\n            \n            for u, tbl in pairs(aura_env.losses) do\n                if #aura_env.losses[u] > 30 then\n                    aura_env.avg[u][drain] = aura_env.average(u) or nil \n                end\n                aura_env.losses[u] = {}\n            end\n            \n            aura_env.active_widget = widget_info.spellInfo.spellID\n        end\n    end\nend\n\n\n",
